import React from "react";
import "./Card.css";
const Card = ({ slide }) => {
  return (
    <>
      <div className="slideContent">
        <img src={slide.img}></img>
        <div className="slideContentInner">
          <h1 className="slideTitle">{slide.title}</h1>
          <p className="slideDescription">{slide.description}</p>
        </div>
      </div>
    </>
  );
};
export default Card;
